demo.repl.help:
ពាក្យបញ្ជាដែលអាចប្រើបាន៖
  @show              ─ បង្ហាញសេចក្ដីសង្ខេប adaptive card ចុងក្រោយ
  @json              ─ បញ្ចេញតម្លៃ JSON ដើមដែលទទួលបានពី flow
  @back              ─ ត្រឡប់ទៅកាត/ទិន្នន័យបញ្ចូលដែលត្រូវបានទប់ស្កាត់មុន
  @input <k>=<v>     ─ កំណត់ ឬ បដិសេធតម្លៃវាលបញ្ចូល
  @click <action_id> ─ ដាក់ស្នើកាតជាមួយសកម្មភាពដែលបានផ្ដល់
  @help              ─ បោះពុម្ពអត្ថបទជំនួយនេះ
  @quit              ─ ចាកចេញពី REPL
